Kareena kapoor inspired makeup look. I hope you like it as much as I do 😂🩷
Posted this in my stories a couple of days ago , asking if I should recreate this look and sooo many of you said yes. Apparently this look was originally done by @mickeycontractor and it’s perfect. Imbibes early 2000s vibes : metallic eyeshadow , frosted glossy pink lips and rosy cheeks. When I finished the look I was like ok I think this is going to be my go-to look from now on lol. You can easily do this too , just save and follow the steps 😇 

